In regards to commits showing up in each stage - actually I think I prefer that. If a commit makes it to A, B, and C I as a user would want to see it in A, B, and C. Otherwise, as a number of people have brought up, some stages will appear to be empty with no data and this is confusing.

> HygieiaUtils.determineArtifactName

The logic looks correct. It assumes a format of 

> artifactname[[-_]version][.ext]

. The artifactName corresponds to the standard maven/ivy concept of an artifact name. This was changed with #913 and #983. Before that artifactName was defined as name + extension (from getFileNameMinusVersion).

With the correction from @rob-miller-777 it should work as intended. In the past the old Jenkins plugin would define artifact name as artifact name + extension (from getFileNameMinusVersion). If the listener could not find data and it detects a file extension in the artifactName (implying the old jenkins plugin was used) it will revert back to using the old method thereby allowing it to work with data from the old Jenkins plugin:

```
-            artifacts = binaryArtifactRepository.findByArtifactNameAndTimestampGreaterThan(environmentComponent.getComponentName(), lastArtifactTimestamp);
+            artifacts.addAll(Lists.newArrayList(binaryArtifactRepository.findByArtifactNameAndArtifactExtensionAndTimestampGreaterThan(artifactName, artifactExtension, lastArtifactTimestamp)));
+            
+            // Backwards compatibility
+            if (artifactExtension != null) {
+	        	// In the past the extension was saved as part of the artifact name
+	            artifacts.addAll(Lists.newArrayList(binaryArtifactRepository.findByArtifactNameAndArtifactExtensionAndTimestampGreaterThan(environmentComponent.getComponentName(), null, lastArtifactTimestamp)));
+            }
``` MarkRx
