Actually there might be more to it. I remember coming across this and finding it to be finicky. The deploy service "artifactName" is a misnomer. Instead it refers to the name of the component that the deploy collector deployed which may or may not be the same. The search in the environment_component repo is being done off of this component name. Depending on how you setup Jenkins / UDeploy / XLD will determine whether or not the current logic works for you. It could use a little attention I suppose. MarkRx
